alt="Boxplots &#10;A boxplot is a graphical display showing the five number summary &#10;and any outlier value. &#10;It is sometimes called box-and-whisker plot. &#10;A central box spans the quartiles. &#10;A line in the box marks the median. &#10;Lines extend from the box out to &#10;the smallest and largest &#10;observations which are not &#10;suspected outliers. &#10;Observations more than I .5 x IOR &#10;outside the central box are plotted &#10;individually as outliers. "></p>
